INSERT INTO `nt_curation_log` VALUES (1,69,'2022-04-02 13:07:31','dB2N2X8B_iFClBvFkoxw',NULL,'<p><span style=\"font-size:28px;\"><strong>M_PETI</strong></span></p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>CM\\1242975EN.docx PE655.830v02-00</p><p>&nbsp;</p><p>&nbsp;</p><p>EN United in diversity EN</p><p>&nbsp;</p><p>&nbsp;</p><p>European Parliament</p><p>&nbsp;</p><p>2019-2024</p><p>&nbsp;</p><p>&nbsp;</p><p>Committee on Petitions</p><p>&nbsp;</p><p>&nbsp;</p><p>18.10.2021</p><p>&nbsp;</p><p>&nbsp;</p><p>NOTICE TO MEMBERS</p><p>&nbsp;</p><p>&nbsp;</p><p>Subject: Petition No 0355/2020 by J.M.B. (Spanish) on the coronavirus crisis</p><p>&nbsp;</p><p>&nbsp;</p><p>1. Summary of petition</p><p>&nbsp;</p><p>&nbsp;</p><p>The petitioner explains that given the COVID-19 crisis that Spain is currently experiencing and</p><p>&nbsp;</p><p>its extension to all over Europe in the coming months; he asks the EU to expand the financing</p><p>&nbsp;</p><p>of the following EU instruments:</p><p>&nbsp;</p><p>&nbsp;</p><p>1. Expand the European Social Fund regarding the promotion of social inclusion to fight</p><p>&nbsp;</p><p>poverty and in order to promote the social inclusion and employment of citizens in this situation.</p><p>&nbsp;</p><p>&nbsp;</p><p>2. Expand the LIFE program: promoting funding scientific research by the member states in</p><p>&nbsp;</p><p>order to reduce environmental problems and health of citizens.</p><p>&nbsp;</p><p>&nbsp;</p><p>3. Innovate through the financial instruments that the European Union has, in order that any</p><p>&nbsp;</p><p>European citizen facing this COVID-19 crisis can receive help and protection from Europe.</p><p>&nbsp;</p><p>&nbsp;</p><p>The petitioner thinks that Europe requires a greater consensus and union to face this global</p><p>&nbsp;</p><p>pandemic decease, if not Euroscepticism will rise.</p><p>&nbsp;</p><p>&nbsp;</p><p>2. Admissibility</p><p>&nbsp;</p><p>&nbsp;</p><p>Declared admissible on 16 April 2020. Information requested from Commission under Rule</p><p>&nbsp;</p><p>227(6).</p><p>&nbsp;</p><p>&nbsp;</p><p>3. Commission reply, received on 24 July 2020</p><p>&nbsp;</p><p>&nbsp;</p><p>The Commission welcomes the ideas conveyed in the petition in relation to targeted EU</p><p>&nbsp;</p><p>measures to ease the impact of the COVID-19 outbreak. These are difficult times for everyone,</p><p>&nbsp;</p><p>and particularly tough for the most vulnerable parts of the population and the millions of</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>PE655.830v02-00 2/9 CM\\1242975EN.docx</p><p>&nbsp;</p><p>&nbsp;</p><p>EN</p><p>&nbsp;</p><p>&nbsp;</p><p>precarious workers in the EU. Beyond any doubt, the COVID-19 outbreak exacerbates existent</p><p>&nbsp;</p><p>inequalities and creates new ones.</p><p>&nbsp;</p><p>&nbsp;</p><p>The Commission is in close contact with national governments, including Spain, to assess and</p><p>&nbsp;</p><p>find solutions to the rapidly emerging needs, mitigate the effects of the COVID-19 pandemic</p><p>&nbsp;</p><p>and combat the pandemic itself. This is why EU rules were revised at unprecedented speed to</p><p>&nbsp;</p><p>give Member States immediate and flexible access to EU funding.</p><p>&nbsp;</p><p>&nbsp;</p><p>In this context, the Commission launched three initiatives: the Recovery Plan, including a new</p><p>&nbsp;</p><p>European recovery instrument (‘Next Generation EU amounting to EUR 750 billion’)1 and a</p><p>&nbsp;</p><p>renewed multi-annual financial framework for the years 2021-20272, the Coronavirus Response</p><p>&nbsp;</p><p>Investment Initiative (CRII)3, and the Coronavirus Response Investment Initiative Plus</p><p>&nbsp;</p><p>(CRII+)4, reflecting the new challenges ahead.</p><p>&nbsp;</p><p>&nbsp;</p><p>The EU Recovery Fund, proposed by the Commission on 27 May 2020, will be based on a</p><p>&nbsp;</p><p>revamped EU seven-year budget (2021-2027). The Recovery Fund is expected to tackle the</p><p>&nbsp;</p><p>deep and long-lasting social and economic impact of the current crisis.</p><p>&nbsp;</p><p>&nbsp;</p><p>Part of the funds under the Next Generation EU will be invested to top-up by EUR 55 billion</p><p>&nbsp;</p><p>the current cohesion policy programmes between now and 2022 under the new REACT-E</p>','<p>somthin</p>'),(2,69,'2022-04-02 13:12:17','bx2N2X8B_iFClBvFkoxu',NULL,'<p>Levelized Costs of New Generation Resources in the Annual Energy Outlook 2021</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>U.S. Energy Information Administration | Levelized Costs of New Generation Resources in the Annual Energy Outlook 2021 1</p><p>&nbsp;</p><p>&nbsp;</p><p>February 2021</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"http://1.214.203.131:3330/2021/12/www.heritage.org/electricity_generation/contentImage/4a069ef68ee972bb07eda3daf2d43667\"></p><p>&nbsp;</p><p>&nbsp;</p><p>Levelized Costs of New Generation Resources in the Annual Energy</p><p>&nbsp;</p><p>Outlook 2021</p><p>&nbsp;</p><p>Levelized cost of electricity (LCOE) refers to the estimates of the revenue required to build and operate a</p><p>&nbsp;</p><p>generator over a specified cost recovery period. Levelized avoided cost of electricity (LACE) is the</p><p>&nbsp;</p><p>revenue available to that generator during the same period. Beginning with the Annual Energy Outlook</p><p>&nbsp;</p><p>2021 (AEO2021), the U.S. Energy Information Administration (EIA) includes estimates for the levelized</p><p>&nbsp;</p><p>cost of storage (LCOS) in addition to LCOE and LACE. This paper presents average values of LCOE, LCOS,</p><p>&nbsp;</p><p>and LACE for electric generating technologies entering service in 2023, 2026,1 and 2040 as represented</p><p>&nbsp;</p><p>in the National Energy Modeling System (NEMS) for the AEO2021 Reference case.2 The costs for electric</p><p>&nbsp;</p><p>generating facilities entering service in 2026 are presented in the body of this report, and the costs for</p><p>&nbsp;</p><p>20233 and 2040 are included in Appendices A and B, respectively. Both a capacity-weighted average</p><p>&nbsp;</p><p>based on projected capacity additions and a simple average (unweighted) of the regional values across</p><p>&nbsp;</p><p>the 25 U.S. supply regions of the NEMS Electricity Market Module (EMM) are provided, together with</p><p>&nbsp;</p><p>the range of regional values.</p><p>&nbsp;</p><p>&nbsp;</p><p>LCOE, LCOS, and LACE are simplifications of modeled decisions, and do not not fully capture all the</p><p>&nbsp;</p><p>factors considered in NEMS. Nevertheless, when used together, the cost and revenue metrics provide a</p><p>&nbsp;</p><p>more intuitive framework for understanding economic competitiveness between generation</p><p>&nbsp;</p><p>technologies in the capacity expansion decisions than considering either metric alone.</p><p>&nbsp;</p><p>&nbsp;</p><p>Levelized Cost of Electricity and Levelized Cost of Storage</p><p>&nbsp;</p><p>Levelized cost of electricity and levelized cost of storage represent the average revenue per unit of</p><p>&nbsp;</p><p>electricity generated that would be required to recover the costs of building and operating a generating</p><p>&nbsp;</p><p>plant and a battery storage facility, respectively, during an assumed financial life and duty cycle.4 LCOE is</p><p>&nbsp;</p><p>often cited as a convenient summary measure of the overall competiveness of different generating</p><p>&nbsp;</p><p>technologies. Although the concept is similar to LCOE, LCOS is different in that it represents an energy</p><p>&nbsp;</p><p>storage technology that contributes to electricity generation when discharging and consumes electricity</p><p>&nbsp;</p><p>from the grid when charging. Furthermore, LCOS is calculated differently depending on whether it is</p><p>&nbsp;</p><p>supplying electricity generation to the grid or providing generation capacity reliability. In NEMS, EIA</p><p>&nbsp;</p><p>models battery storage in energy arbitrage applications where the storage technology provides energy</p><p>&nbsp;</p><p>to the grid during periods of high-cost generation and recharges during periods of lower cos</p>','<p>ㅇㄴㅁㅇㅇㄴㅁㅇㅁㄴ</p>'),(3,64,'2022-04-10 15:12:51','aB2m1n8B_iFClBvFDYzI',NULL,NULL,'<p><span style=\"font-size:20px;\"><strong>The Employment Situation - November 2021</strong></span></p><p>&nbsp;</p><p>Transmission of material in this news release is embargoed until USDL-21-2075</p><p>&nbsp;</p><p>8:30 a.m. (ET) Friday, December 3, 2021</p><p>&nbsp;</p><p>&nbsp;</p><p>Technical information:</p><p>&nbsp;</p><p>&nbsp;</p><p>Household data: (202) 691-6378 • cpsinfo@bls.gov • www.bls.gov/cps</p><p>&nbsp;</p><p>Establishment data: (202) 691-6555 • cesinfo@bls.gov • www.bls.gov/ces</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Media contact: (202) 691-5902 • PressOffice@bls.gov</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>THE EMPLOYMENT SITUATION — NOVEMBER 2021</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Total nonfarm payroll employment rose by 210,000 in November, and the unemployment rate fell by</p><p>&nbsp;</p><p>0.4 percentage point to 4.2 percent, the U.S. Bureau of Labor Statistics reported today. Notable job gains</p><p>&nbsp;</p><p>occurred in professional and business services, transportation and warehousing, construction, and</p><p>&nbsp;</p><p>manufacturing. Employment in retail trade declined over the month.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>This news release presents statistics from two monthly surveys. The household survey measures labor</p><p>&nbsp;</p><p>force status, including unemployment, by demographic characteristics. The establishment survey</p><p>&nbsp;</p><p>measures nonfarm employment, hours, and earnings by industry. For more information about the</p><p>&nbsp;</p><p>concepts and statistical methodology used in these two surveys, see the Technical Note.</p><p>&nbsp;</p><p>&nbsp;</p><p>Household Survey Data</p><p>&nbsp;</p><p>&nbsp;</p><p>The unemployment rate fell by 0.4 percentage point to 4.2 percent in November. The number of</p><p>&nbsp;</p><p>unemployed persons fell by 542,000 to 6.9 million. Both measures are down considerably from their</p><p>&nbsp;</p><p>highs at the end of the February-April 2020 recession. However, they remain above their levels prior to</p><p>&nbsp;</p><p>the coronavirus (COVID-19) pandemic (3.5 percent and 5.7 million, respectively, in February 2020).</p><p>&nbsp;</p><p>&nbsp;</p><p>Chart 1. Unemployment rate, seasonally adjusted,</p><p>&nbsp;</p><p>November 2019 – November 2021</p><p>&nbsp;</p><p>Percent</p><p>&nbsp;</p><p>&nbsp;</p><p>125,000</p><p>&nbsp;</p><p>&nbsp;</p><p>130,000</p><p>&nbsp;</p><p>&nbsp;</p><p>135,000</p><p>&nbsp;</p><p>&nbsp;</p><p>140,000</p><p>&nbsp;</p><p>&nbsp;</p><p>145,000</p><p>&nbsp;</p><p>&nbsp;</p><p>150,000</p><p>&nbsp;</p><p>&nbsp;</p><p>155,000</p><p>&nbsp;</p><p>&nbsp;</p><p>160,000</p><p>&nbsp;</p><p>&nbsp;</p><p>Nov-19 Feb-20 May-20 Aug-20 Nov-20 Feb-21 May-21 Aug-21 Nov-21</p><p>&nbsp;</p><p>&nbsp;</p><p>Thousands</p><p>&nbsp;</p><p>&nbsp;</p><p>Chart 2. Nonfarm payroll employment, seasonally adjusted,</p><p>&nbsp;</p><p>November 2019 – November 2021</p><p>&nbsp;</p><p>&nbsp;</p><p>2.0</p><p>&nbsp;</p><p>&nbsp;</p><p>4.0</p><p>&nbsp;</p><p>&nbsp;</p><p>6.0</p><p>&nbsp;</p><p>&nbsp;</p><p>8.0</p><p>&nbsp;</p><p>&nbsp;</p><p>10.0</p><p>&nbsp;</p><p>&nbsp;</p><p>12.0</p><p>&nbsp;</p><p>&nbsp;</p><p>14.0</p><p>&nbsp;</p><p>&nbsp;</p><p>16.0</p><p>&nbsp;</p><p>&nbsp;</p><p>Nov-19 Feb-20 May-20 Aug-20 Nov-20 Feb-21 May-21 Aug-21 Nov-21</p><p>&nbsp;</p><p>&nbsp;</p><p>http://www.bls.gov/cps</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>-2-</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>(See table A-1. See the box note on page 5 for more information about how the household survey and its</p><p>&nbsp;</p><p>measures were affected by the coronavirus pandemic.)</p><p>&nbsp;</p><p>&nbsp;</p><p>Among the major worker groups, the unemployment rates for adult men (4.0 percent), adult women</p><p>&nbsp;</p><p>(4.0 percent), Whites (3.7 percent), Blacks (6.7 percent), and Hispanics (5.2 percent) declined in</p><p>&nbsp;</p><p>November. The jobless rates for teenagers (11.2 percent) and Asians (3.8 percent) showed little change</p><p>&nbsp;</p><p>over the month. (See tables A-1, A-2, and A-3.)</p><p>&nbsp;</p><p>&nbsp;</p><p>Among the unemployed, the number of permanent job losers declined by 205,000 to 1.9 million in</p><p>&nbsp;</p><p>November but is 623,000 higher than in February 2020. The number of persons on temporary layoff</p><p>&nbsp;</p><p>decreased by 255,000 to 801,000 in November. This measure is down from the high of 18.0 million in</p><p>&nbsp;</p><p>April 2020 and has nearly returned to its February 202</p>'),(4,64,'2022-04-10 15:14:08','aB2m1n8B_iFClBvFDYzI',NULL,'<p><span style=\"font-size:20px;\"><strong>The Employment Situation - November 2021</strong></span></p><p>&nbsp;</p><p>Transmission of material in this news release is embargoed until USDL-21-2075</p><p>&nbsp;</p><p>8:30 a.m. (ET) Friday, December 3, 2021</p><p>&nbsp;</p><p>&nbsp;</p><p>Technical information:</p><p>&nbsp;</p><p>&nbsp;</p><p>Household data: (202) 691-6378 • cpsinfo@bls.gov • www.bls.gov/cps</p><p>&nbsp;</p><p>Establishment data: (202) 691-6555 • cesinfo@bls.gov • www.bls.gov/ces</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Media contact: (202) 691-5902 • PressOffice@bls.gov</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>THE EMPLOYMENT SITUATION — NOVEMBER 2021</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Total nonfarm payroll employment rose by 210,000 in November, and the unemployment rate fell by</p><p>&nbsp;</p><p>0.4 percentage point to 4.2 percent, the U.S. Bureau of Labor Statistics reported today. Notable job gains</p><p>&nbsp;</p><p>occurred in professional and business services, transportation and warehousing, construction, and</p><p>&nbsp;</p><p>manufacturing. Employment in retail trade declined over the month.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbs