HE EMPLOYMENT SITUATION — NOVEMBER 2021</strong></span></p><p>&nbsp;</p><p>Total nonfarm payroll employment rose by 210,000 in November, and the unemployment rate fell by</p><p>&nbsp;</p><p>0.4 percentage point to 4.2 percent, the U.S. Bureau of Labor Statistics reported today. Notable job gains</p><p>&nbsp;</p><p>occurred in professional and business services, transportation and warehousing, construction, and</p><p>&nbsp;</p><p>manufacturing. Employment in retail trade declined over the month.</p><p>&nbsp;</p><p>&nbsp;</p><p>This news release presents statistics from two monthly surveys. The household survey measures labor</p><p>&nbsp;</p><p>force status, including unemployment, by demographic characteristics. The establishment survey</p><p>&nbsp;</p><p>measures nonfarm employment, hours, and earnings by industry. For more information about the</p><p>&nbsp;</p><p>concepts and statistical methodology used in these two surveys, see the Technical Note.</p><p>&nbsp;</p><p>&nbsp;</p><p>Household Survey Data</p><p>&nbsp;</p><p>&nbsp;</p><p>The unemployment rate fell by 0.4 percentage point to 4.2 percent in November. The number of</p><p>&nbsp;</p><p>unemployed persons fell by 542,000 to 6.9 million. Both measures are down considerably from their</p><p>&nbsp;</p><p>highs at the end of the February-April 2020 recession. However, they remain above their levels prior to</p><p>&nbsp;</p><p>the coronavirus (COVID-19) pandemic (3.5 percent and 5.7 million, respectively, in February 2020).</p><p>&nbsp;</p><p>&nbsp;</p><p>Chart 1. Unemployment rate, seasonally adjusted,</p><p>&nbsp;</p><p>November 2019 – November 2021</p><p>&nbsp;</p><p>Percent</p><p>&nbsp;</p><p>125,000</p><p>130,000</p><p>135,000</p><p>140,000</p><p>145,000</p><p>150,000</p><p>155,000</p><p>160,000</p><p>&nbsp;</p><p>&nbsp;</p><p>Nov-19 Feb-20 May-20 Aug-20 Nov-20 Feb-21 May-21 Aug-21 Nov-21</p><p>&nbsp;</p><p>&nbsp;</p><p>Thousands</p><p>&nbsp;</p><p>&nbsp;</p><p>Chart 2. Nonfarm payroll employment, seasonally adjusted,</p><p>&nbsp;</p><p>November 2019 – November 2021</p><p>&nbsp;</p><p>&nbsp;</p><p>2.0</p><p>4.0</p><p>6.0</p><p>8.0</p><p>10.0</p><p>12.0</p><p>14.0</p><p>16.0</p><p>&nbsp;</p><p>&nbsp;</p><p>Nov-19 Feb-20 May-20 Aug-20 Nov-20 Feb-21 May-21 Aug-21 Nov-21</p><p>&nbsp;</p><p>&nbsp;</p><p>http://www.bls.gov/cps</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>-2-</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>(See table A-1. See the box note on page 5 for more information about how the household survey and its</p><p>&nbsp;</p><p>measures were affected by the coronavirus pandemic.)</p><p>&nbsp;</p><p>&nbsp;</p><p>Among the major worker groups, the unemployment rates for adult men (4.0 percent), adult women</p><p>&nbsp;</p><p>(4.0 percent), Whites (3.7 percent), Blacks (6.7 percent), and Hispanics (5.2 percent) declined in</p><p>&nbsp;</p><p>November. The jobless rates for teenagers (11.2 percent) and Asians (3.8 percent) showed little change</p><p>&nbsp;</p><p>over the month. (See tables A-1, A-2, and A-3.)</p><p>&nbsp;</p><p>&nbsp;</p><p>Among the unemployed, the number of permanent job losers declined by 205,000 to 1.9 million in</p><p>&nbsp;</p><p>November but is 623,000 higher than in February 2020. The number of persons on temporary layoff</p><p>&nbsp;</p><p>decreased by 255,000 to 801,000 in November. This measure is down from the high of 18.0 million in</p><p>&nbsp;</p><p>April 2020 and has nearly returned to its February 202</p>'),(5,69,'2022-04-11 13:57:04','bB2N2X8B_iFClBvFkoxY',NULL,NULL,'<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>20200519STO79425_en.pdf</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Creating a sustainable food system: the EU\'s</p><p>&nbsp;</p><p>strategy</p><p>&nbsp;</p><p>&nbsp;</p><p>The EU\'s food sustainability strategy aims to protect the environment and ensure healthy</p><p>&nbsp;</p><p>food for everyone, whilst ensuring farmers’ livelihoods.</p><p>&nbsp;</p><p>&nbsp;</p><p>The food system, from production to consumption and waste, has a significant impact on the</p><p>&nbsp;</p><p>environment, health and food safety. With the Farm to Fork Strategy presented on 20 May</p><p>&nbsp;</p><p>2020, the European Commission aims to create a sustainable EU food system that safeguards</p><p>&nbsp;</p><p>food security and protects people and the natural world.</p><p>&nbsp;</p><p>&nbsp;</p><p>Setting targets</p><p>&nbsp;</p><p>&nbsp;</p><p>The strategy provides the framework for a series of laws that the Commission will propose,&nbsp;</p><p>&nbsp;</p><p>ranging from a revision of EU pesticides legislation, new EU animal welfare rules and plans to</p><p>&nbsp;</p><p>address food waste and tackle food fraud to food labelling, a carbon farming initiative and the</p><p>&nbsp;</p><p>reform of the EU farm system.</p><p>&nbsp;</p><p>&nbsp;</p><p>It will complement existing EU legislation and build a comprehensive framework that covers the</p><p>&nbsp;</p><p>whole food supply chain.</p><p>&nbsp;</p><p>&nbsp;</p><p>All the proposals will need to be negotiated with and approved by the Council and Parliament.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Creating an eco-friendly food system</p><p>&nbsp;</p><p>&nbsp;</p><p>Article</p><p>&nbsp;</p><p>30-11-2021 - 12:10</p><p>&nbsp;</p><p>20200519STO79425</p><p>&nbsp;</p><p>&nbsp;</p><p>The strategy’s key goals for 2030:</p><p>&nbsp;</p><p>• 50% reduction in the use and risk of pesticides</p><p>&nbsp;</p><p>&nbsp;</p><p>• at least 20% reduction in the use of fertilisers</p><p>&nbsp;</p><p>&nbsp;</p><p>• 50% reduction in sales of antimicrobials used for farmed animals and aquaculture</p><p>&nbsp;</p><p>&nbsp;</p><p>• 25% of agricultural land to be used for organic farming</p><p>&nbsp;</p><p>&nbsp;</p><p>EN Directorate General for CommunicationEuropean Parliament - Spokesperson: Jaume Duch GuillotContact: webmaster@europarl.eu 1 I 3</p><p>&nbsp;</p><p>&nbsp;</p><p>https://eur-lex.europa.eu/legal-content/EN/TXT/?qid=1590404602495&amp;uri=CELEX:52020DC0381</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Although EU agriculture is the only major farm sector worldwide to have reduced its greenhouse</p><p>&nbsp;</p><p>gas emissions (by 20% since 1990), it still accounts for about 10% of greenhouse gas</p><p>&nbsp;</p><p>emissions (of which 70% are due to animals) Together with manufacturing, processing,</p><p>&nbsp;</p><p>packaging and transportation, the food sector is one the main drivers of climate change.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>According to the strategy, a shift in our way of producing, buying and consuming food is</p><p>&nbsp;</p><p>necessary to improve the environmental footprint and help mitigate climate change, whilst</p><p>&nbsp;</p><p>protecting the livelihoods of all economic actors in the food chain, by generating fairer economic</p><p>&nbsp;</p><p>returns and opening up new business opportunities.</p><p>&nbsp;</p><p>&nbsp;</p><p>The Farm to Fork Strategy is part of the European Green Deal and its goal of making the EU</p><p>&nbsp;</p><p>climate neutral by 2050, which is closely linked to the new Biodiversity Strategy 2030 and the</p><p>&nbsp;</p><p>new Common Agricultural Policy (CAP) reforms.</p><p>&nbsp;</p><p>&nbsp;</p><p>It aims to make the EU food system more robust and resilient to future crises like Covid-19 and</p><p>&nbsp;</p><p>more recurrent natural disasters such as floods or droughts.</p><p>&nbsp;</p><p>&nbsp;</p><p>Find out how the EU supports farmers&nbsp;through the CAP.</p><p>&nbsp;</p><p>&nbsp;</p><p>Ensuring affordable, healthy and sustainable food</p><p>&nbsp;</p><p>The Farm to Fork Strategy intends to ensure affordable safe and</p>'),(6,64,'2022-04-16 18:55:08','fh0Q2n8B_iFClBvFH4w-',NULL,NULL,'<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>事業再編Q&amp;A</p><p>&nbsp;</p><p>計画対象</p><p>&nbsp;</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>どのような企業が対象となりますか？</p><p>&nbsp;</p><p>　合併や会社分割等の事業再編を行い、かつ、新商品開発や生産・販売の効率化等の前向きな取組により生産性の向上を目指す企業が対</p><p>&nbsp;</p><p>象となります。</p><p>&nbsp;</p><p>&nbsp;</p><p>企業以外でも利用できますか？ 　株式会社や合同会社だけでなく、個人事業主、事業協同組合なども利用することができます。</p><p>&nbsp;</p><p>上場企業や大企業しか利用できないのですか？ 　大企業、中小企業など規模にかかわらず、要件を満たせば認定を受けることができます。</p><p>&nbsp;</p><p>&nbsp;</p><p>法的整理（会社更生法、民事再生法等）の手続中の企業でも利用でき</p><p>&nbsp;</p><p>ますか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　法的整理の手続に入ると、その事業計画は債権者集会の可決や裁判所の認可を得る必要があり、経営者だけで決定することができなくなりま</p><p>&nbsp;</p><p>す。計画の確実な実施という観点から、裁判所の認可前に、認定を行うことは想定しておりません。</p><p>&nbsp;</p><p>　ただし、法的整理中の企業は活用できませんが、例えば、ある企業が民事再生法の適用企業から事業を承継し、有効に活用することで当該事</p><p>&nbsp;</p><p>業の生産性向上に取り組む場合は申請可能です（事業を譲渡する側が、清算予定中の企業や法的整理中の企業でも申請可能です）。</p><p>&nbsp;</p><p>&nbsp;</p><p>債権放棄を受ける予定の事業者は利用できますか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　債権放棄を受ける予定の事業者であっても認定を受けることができます。</p><p>&nbsp;</p><p>　ただし、計画が円滑かつ確実に実施されるかどうかを判断するために、通常の申請書類に加えて、「債権者との間での債権放棄に関する合意書</p><p>&nbsp;</p><p>面」「公認会計士・監査法人の報告書」「専門家の調査報告書」等の追加の書類提出や手続が必要となります。詳細は『債権放棄を含む計画</p><p>&nbsp;</p><p>Ｑ＆Ａ（以下ＵＲＬ）』を参照ください。</p><p>&nbsp;</p><p>http://www.meti.go.jp/policy/jigyou_saisei/kyousouryoku_kyouka/saihen/12_DQA.pdf(修正要)</p><p>&nbsp;</p><p>&nbsp;</p><p>２者以上で申請することはできますか？ 　複数の事業者が共同で計画を申請することができます。</p><p>&nbsp;</p><p>&nbsp;</p><p>子会社などを計画に含めることはできますか？</p><p>&nbsp;</p><p>　申請者が過半数の株式を所有する子会社等であって、事業再編のための措置を行うなど計画と関係がある場合は、『関係事業者』や『外国関</p><p>&nbsp;</p><p>係法人』として計画に含めることができます。</p><p>&nbsp;</p><p>　計画に含めることで、当該子会社等も登録免許税の軽減や中小企業基盤整備機構の債務保証等の支援措置を活用することが出来ます。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>計画期間</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>事業再編計画の実施期間はいつからいつまでですか？</p><p>&nbsp;</p><p>　原則３年以内としておりますが、大規模な設備投資を行うものに限り５年に設定が可能です。</p><p>&nbsp;</p><p>　開始時期は、認定が見込まれる時期以降となるため、申請時期以前の期日とすることはできません。実施期間内において、生産性の向上等の</p><p>&nbsp;</p><p>要件の達成見込みを判定します。</p><p>&nbsp;</p><p>&nbsp;</p><p>計画の基準年度はいつになりますか？</p><p>&nbsp;</p><p>　基準年度は、申請時点における直近の確定決算となります。原則として、株主総会の了承を得た確定決算を適用しますが、既に新しい決算</p><p>&nbsp;</p><p>短信が出ていて、決算短信を使用する方が前年度の確定決算よりも実態に即しているなど特別な理由がある場合は、申請先の主務省庁に御</p><p>&nbsp;</p><p>相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>認定を受けた後、計画期間を変更することはできますか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　事業再編計画の場合、当初計画の開始時期から３年（計画期間が５年の場合には５年）を越えない範囲であれば、計画変更手続によっ</p><p>&nbsp;</p><p>て変更することができます。</p><p>&nbsp;</p><p>　なお、計画期間を変更する場合も、当初計画申請時と同様に、生産性、財務健全性等の認定基準を満たさなければ、認定を受けることがで</p><p>&nbsp;</p><p>きません。</p><p>&nbsp;</p><p>&nbsp;</p><p>生産性向上の基準</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>生産性向上の基準とは何ですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　申請時点における直近の確定決算を基準年度として、計画の終了時期を含む決算年度を目標年度として、基準年度から目標年度までの向</p><p>&nbsp;</p><p>上によって次のいずれかの基準を満たす必要があります。</p><p>&nbsp;</p><p>　①修正ＲＯＡ　２％ポイント向上</p><p>&nbsp;</p><p>　②有形固定資産回転率　５％向上</p><p>&nbsp;</p><p>　③従業員1人当たり付加価値額　６％向上</p><p>&nbsp;</p><p>&nbsp;</p><p>【計算方式】</p><p>&nbsp;</p><p>&nbsp;</p><p>数値目標の算定単位は何ですか？ 　事業部門単位で算定します。なお、計画の対象となる事業部門が複数の企業に存在する場合、各社にある当該事業部門の数値を合算での算定も可能です。</p><p>&nbsp;</p><p>資本金の増加額や公開買付け後の合併条件など計画に記載すべき事項の</p><p>&nbsp;</p><p>一部が未定である場合は、どうすればよいですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　計画の一部について申請時に未定である場合については、計画中に「未定」として記載し、後で計画変更を行うことができますので、申請先の主</p><p>&nbsp;</p><p>務省庁にご相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>複数事業者（関係事業者、外国関係法人を含む）が共同で申請する場</p><p>&nbsp;</p><p>合、事業者間で決算期がズレている場合は、どうすれば良いのか？ 　実態に応じてケースバイケースで判断しますので、申請先の主務省庁にご相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>財務内容の健全性の向上の基準</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>財務内容の健全性の向上の基準とは何ですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　申請事業者（複数の場合は各事業者それぞれ）の単体で次の両方の基準を満たす必要があります。それぞれの計算手法につきましては、様</p><p>&nbsp;</p><p>式（テンプレート）の添付書面のエクセルファイルをご覧ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>計画の終了年度において次の両方の達成が見込まれること。</p><p>&nbsp;</p><p>①有利子負債／キャッシュフロー≦１０倍　②経常収入＞経常支出</p><p>&nbsp;</p><p>&nbsp;</p><p>数値目標は、連結グループで算定することはできますか？</p><p>&nbsp;</p><p>　グループ全体の資金を持株会社等が一括管理するなど、連結ベースの方が実態に即している場合には、複数事業者の連結ベースで判断する</p><p>&nbsp;</p><p>場合もあります。連結ベースの適用を検討されている場合は、申請先の主務省庁にご相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>関係事業者の分も必要ですか？ 　一義的には申請事業者が本基準を満たすかどうかで判断しますが、計画の実行性を担保する観点から、関係事業者が基準を満たすかどうかも</p><p>&nbsp;</p><p>審査時に確認しておりますので、関係事業者の分も提出をお願いします。</p><p>&nbsp;</p><p>&nbsp;</p><p>前向きな取組の基準</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>前向きな取組の基準とは何ですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　計画の終了年度において次のいずれかの基準を満たす必要があります。</p><p>&nbsp;</p><p>①新商品・新サービスの開発・生産・提供 ⇒　　　　新商品等の売上高比率を全社売上高の１％以上</p><p>&nbsp;</p><p>②商品の新生産方式の導入、設備の能率の向上 ⇒　　　　商品等１単位当たりの製造原価を５％以上削減</p><p>&nbsp;</p><p>③商品の新販売方式の導入、サービスの新提供方式の導入 ⇒　　　　商品等１単位当たりの販売費を５％以上削減</p><p>&nbsp;</p><p>④新原材料・部品・半製品の使用、原材料・部品・半製品の新購入方式の導入</p><p>&nbsp;</p><p>　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　 ⇒　　 　 商品１単位当たりの製造原価を５％以上削減</p><p>&nbsp;</p><p>&nbsp;</p><p>複数事業者（関係事業者、外国関係法人を含む）が共同で申請する場</p><p>&nbsp;</p><p>合、それぞれの事業者が前向きな取組を行う必要がありますか？ 　原則として、申請に関わる事業者全員がそれぞれ前向きな取組を行う必要はありません。</p><p>&nbsp;</p><p>&nbsp;</p><p>「新商</p>'),(7,69,'2022-04-16 23:55:18','fh0Q2n8B_iFClBvFH4w-',NULL,'<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>事業再編Q&amp;A</p><p>&nbsp;</p><p>計画対象</p><p>&nbsp;</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>どのような企業が対象となりますか？</p><p>&nbsp;</p><p>　合併や会社分割等の事業再編を行い、かつ、新商品開発や生産・販売の効率化等の前向きな取組により生産性の向上を目指す企業が対</p><p>&nbsp;</p><p>象となります。</p><p>&nbsp;</p><p>&nbsp;</p><p>企業以外でも利用できますか？ 　株式会社や合同会社だけでなく、個人事業主、事業協同組合なども利用することができます。</p><p>&nbsp;</p><p>上場企業や大企業しか利用できないのですか？ 　大企業、中小企業など規模にかかわらず、要件を満たせば認定を受けることができます。</p><p>&nbsp;</p><p>&nbsp;</p><p>法的整理（会社更生法、民事再生法等）の手続中の企業でも利用でき</p><p>&nbsp;</p><p>ますか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　法的整理の手続に入ると、その事業計画は債権者集会の可決や裁判所の認可を得る必要があり、経営者だけで決定することができなくなりま</p><p>&nbsp;</p><p>す。計画の確実な実施という観点から、裁判所の認可前に、認定を行うことは想定しておりません。</p><p>&nbsp;</p><p>　ただし、法的整理中の企業は活用できませんが、例えば、ある企業が民事再生法の適用企業から事業を承継し、有効に活用することで当該事</p><p>&nbsp;</p><p>業の生産性向上に取り組む場合は申請可能です（事業を譲渡する側が、清算予定中の企業や法的整理中の企業でも申請可能です）。</p><p>&nbsp;</p><p>&nbsp;</p><p>債権放棄を受ける予定の事業者は利用できますか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　債権放棄を受ける予定の事業者であっても認定を受けることができます。</p><p>&nbsp;</p><p>　ただし、計画が円滑かつ確実に実施されるかどうかを判断するために、通常の申請書類に加えて、「債権者との間での債権放棄に関する合意書</p><p>&nbsp;</p><p>面」「公認会計士・監査法人の報告書」「専門家の調査報告書」等の追加の書類提出や手続が必要となります。詳細は『債権放棄を含む計画</p><p>&nbsp;</p><p>Ｑ＆Ａ（以下ＵＲＬ）』を参照ください。</p><p>&nbsp;</p><p>http://www.meti.go.jp/policy/jigyou_saisei/kyousouryoku_kyouka/saihen/12_DQA.pdf(修正要)</p><p>&nbsp;</p><p>&nbsp;</p><p>２者以上で申請することはできますか？ 　複数の事業者が共同で計画を申請することができます。</p><p>&nbsp;</p><p>&nbsp;</p><p>子会社などを計画に含めることはできますか？</p><p>&nbsp;</p><p>　申請者が過半数の株式を所有する子会社等であって、事業再編のための措置を行うなど計画と関係がある場合は、『関係事業者』や『外国関</p><p>&nbsp;</p><p>係法人』として計画に含めることができます。</p><p>&nbsp;</p><p>　計画に含めることで、当該子会社等も登録免許税の軽減や中小企業基盤整備機構の債務保証等の支援措置を活用することが出来ます。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>計画期間</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>事業再編計画の実施期間はいつからいつまでですか？</p><p>&nbsp;</p><p>　原則３年以内としておりますが、大規模な設備投資を行うものに限り５年に設定が可能です。</p><p>&nbsp;</p><p>　開始時期は、認定が見込まれる時期以降となるため、申請時期以前の期日とすることはできません。実施期間内において、生産性の向上等の</p><p>&nbsp;</p><p>要件の達成見込みを判定します。</p><p>&nbsp;</p><p>&nbsp;</p><p>計画の基準年度はいつになりますか？</p><p>&nbsp;</p><p>　基準年度は、申請時点における直近の確定決算となります。原則として、株主総会の了承を得た確定決算を適用しますが、既に新しい決算</p><p>&nbsp;</p><p>短信が出ていて、決算短信を使用する方が前年度の確定決算よりも実態に即しているなど特別な理由がある場合は、申請先の主務省庁に御</p><p>&nbsp;</p><p>相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>認定を受けた後、計画期間を変更することはできますか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　事業再編計画の場合、当初計画の開始時期から３年（計画期間が５年の場合には５年）を越えない範囲であれば、計画変更手続によっ</p><p>&nbsp;</p><p>て変更することができます。</p><p>&nbsp;</p><p>　なお、計画期間を変更する場合も、当初計画申請時と同様に、生産性、財務健全性等の認定基準を満たさなければ、認定を受けることがで</p><p>&nbsp;</p><p>きません。</p><p>&nbsp;</p><p>&nbsp;</p><p>生産性向上の基準</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>生産性向上の基準とは何ですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　申請時点における直近の確定決算を基準年度として、計画の終了時期を含む決算年度を目標年度として、基準年度から目標年度までの向</p><p>&nbsp;</p><p>上によって次のいずれかの基準を満たす必要があります。</p><p>&nbsp;</p><p>　①修正ＲＯＡ　２％ポイント向上</p><p>&nbsp;</p><p>　②有形固定資産回転率　５％向上</p><p>&nbsp;</p><p>　③従業員1人当たり付加価値額　６％向上</p><p>&nbsp;</p><p>&nbsp;</p><p>【計算方式】</p><p>&nbsp;</p><p>&nbsp;</p><p>数値目標の算定単位は何ですか？ 　事業部門単位で算定します。なお、計画の対象となる事業部門が複数の企業に存在する場合、各社にある当該事業部門の数値を合算での算定も可能です。</p><p>&nbsp;</p><p>資本金の増加額や公開買付け後の合併条件など計画に記載すべき事項の</p><p>&nbsp;</p><p>一部が未定である場合は、どうすればよいですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　計画の一部について申請時に未定である場合については、計画中に「未定」として記載し、後で計画変更を行うことができますので、申請先の主</p><p>&nbsp;</p><p>務省庁にご相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>複数事業者（関係事業者、外国関係法人を含む）が共同で申請する場</p><p>&nbsp;</p><p>合、事業者間で決算期がズレている場合は、どうすれば良いのか？ 　実態に応じてケースバイケースで判断しますので、申請先の主務省庁にご相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>財務内容の健全性の向上の基準</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>財務内容の健全性の向上の基準とは何ですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　申請事業者（複数の場合は各事業者それぞれ）の単体で次の両方の基準を満たす必要があります。それぞれの計算手法につきましては、様</p><p>&nbsp;</p><p>式（テンプレート）の添付書面のエクセルファイルをご覧ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>計画の終了年度において次の両方の達成が見込まれること。</p><p>&nbsp;</p><p>①有利子負債／キャッシュフロー≦１０倍　②経常収入＞経常支出</p><p>&nbsp;</p><p>&nbsp;</p><p>数値目標は、連結グループで算定することはできますか？</p><p>&nbsp;</p><p>　グループ全体の資金を持株会社等が一括管理するなど、連結ベースの方が実態に即している場合には、複数事業者の連結ベースで判断する</p><p>&nbsp;</p><p>場合もあります。連結ベースの適用を検討されている場合は、申請先の主務省庁にご相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>関係事業者の分も必要ですか？ 　一義的には申請事業者が本基準を満たすかどうかで判断しますが、計画の実行性を担保する観点から、関係事業者が基準を満たすかどうかも</p><p>&nbsp;</p><p>審査時に確認しておりますので、関係事業者の分も提出をお願いします。</p><p>&nbsp;</p><p>&nbsp;</p><p>前向きな取組の基準</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>前向きな取組の基準とは何ですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　計画の終了年度において次のいずれかの基準を満たす必要があります。</p><p>&nbsp;</p><p>①新商品・新サービスの開発・生産・提供 ⇒　　　　新商品等の売上高比率を全社売上高の１％以上</p><p>&nbsp;</p><p>②商品の新生産方式の導入、設備の能率の向上 ⇒　　　　商品等１単位当たりの製造原価を５％以上削減</p><p>&nbsp;</p><p>③商品の新販売方式の導入、サービスの新提供方式の導入 ⇒　　　　商品等１単位当たりの販売費を５％以上削減</p><p>&nbsp;</p><p>④新原材料・部品・半製品の使用、原材料・部品・半製品の新購入方式の導入</p><p>&nbsp;</p><p>　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　 ⇒　　 　 商品１単位当たりの製造原価を５％以上削減</p><p>&nbsp;</p><p>&nbsp;</p><p>複数事業者（関係事業者、外国関係法人を含む）が共同で申請する場</p><p>&nbsp;</p><p>合、それぞれの事業者が前向きな取組を行う必要がありますか？ 　原則として、申請に関わる事業者全員がそれぞれ前向きな取組を行う必要はありません。</p><p>&nbsp;</p><p>&nbsp;</p><p>「新商</p>','<p>&nbsp;</p><p>事業再編Q&amp;A</p><p>&nbsp;</p><p>計画対象</p><p>&nbsp;</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>どのような企業が対象となりますか？</p><p>&nbsp;</p><p>　合併や会社分割等の事業再編を行い、かつ、新商品開発や生産・販売の効率化等の前向きな取組により生産性の向上を目指す企業が対</p><p>&nbsp;</p><p>象となります。</p><p>&nbsp;</p><p>&nbsp;</p><p>企業以外でも利用できますか？ 　株式会社や合同会社だけでなく、個人事業主、事業協同組合なども利用することができます。</p><p>&nbsp;</p><p>上場企業や大企業しか利用できないのですか？ 　大企業、中小企業など規模にかかわらず、要件を満たせば認定を受けることができます。</p><p>&nbsp;</p><p>&nbsp;</p><p>法的整理（会社更生法、民事再生法等）の手続中の企業でも利用でき</p><p>&nbsp;</p><p>ますか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　法的整理の手続に入ると、その事業計画は債権者集会の可決や裁判所の認可を得る必要があり、経営者だけで決定することができなくなりま</p><p>&nbsp;</p><p>す。計画の確実な実施という観点から、裁判所の認可前に、認定を行うことは想定しておりません。</p><p>&nbsp;</p><p>　ただし、法的整理中の企業は活用できませんが、例えば、ある企業が民事再生法の適用企業から事業を承継し、有効に活用することで当該事</p><p>&nbsp;</p><p>業の生産性向上に取り組む場合は申請可能です（事業を譲渡する側が、清算予定中の企業や法的整理中の企業でも申請可能です）。</p><p>&nbsp;</p><p>&nbsp;</p><p>債権放棄を受ける予定の事業者は利用できますか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　債権放棄を受ける予定の事業者であっても認定を受けることができます。</p><p>&nbsp;</p><p>　ただし、計画が円滑かつ確実に実施されるかどうかを判断するために、通常の申請書類に加えて、「債権者との間での債権放棄に関する合意書</p><p>&nbsp;</p><p>面」「公認会計士・監査法人の報告書」「専門家の調査報告書」等の追加の書類提出や手続が必要となります。詳細は『債権放棄を含む計画</p><p>&nbsp;</p><p>Ｑ＆Ａ（以下ＵＲＬ）』を参照ください。</p><p>&nbsp;</p><p>http://www.meti.go.jp/policy/jigyou_saisei/kyousouryoku_kyouka/saihen/12_DQA.pdf(修正要)</p><p>&nbsp;</p><p>&nbsp;</p><p>２者以上で申請することはできますか？ 　複数の事業者が共同で計画を申請することができます。</p><p>&nbsp;</p><p>&nbsp;</p><p>子会社などを計画に含めることはできますか？</p><p>&nbsp;</p><p>　申請者が過半数の株式を所有する子会社等であって、事業再編のための措置を行うなど計画と関係がある場合は、『関係事業者』や『外国関</p><p>&nbsp;</p><p>係法人』として計画に含めることができます。</p><p>&nbsp;</p><p>　計画に含めることで、当該子会社等も登録免許税の軽減や中小企業基盤整備機構の債務保証等の支援措置を活用することが出来ます。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>計画期間</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>事業再編計画の実施期間はいつからいつまでですか？</p><p>&nbsp;</p><p>　原則３年以内としておりますが、大規模な設備投資を行うものに限り５年に設定が可能です。</p><p>&nbsp;</p><p>　開始時期は、認定が見込まれる時期以降となるため、申請時期以前の期日とすることはできません。実施期間内において、生産性の向上等の</p><p>&nbsp;</p><p>要件の達成見込みを判定します。</p><p>&nbsp;</p><p>&nbsp;</p><p>計画の基準年度はいつになりますか？</p><p>&nbsp;</p><p>　基準年度は、申請時点における直近の確定決算となります。原則として、株主総会の了承を得た確定決算を適用しますが、既に新しい決算</p><p>&nbsp;</p><p>短信が出ていて、決算短信を使用する方が前年度の確定決算よりも実態に即しているなど特別な理由がある場合は、申請先の主務省庁に御</p><p>&nbsp;</p><p>相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>認定を受けた後、計画期間を変更することはできますか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　事業再編計画の場合、当初計画の開始時期から３年（計画期間が５年の場合には５年）を越えない範囲であれば、計画変更手続によっ</p><p>&nbsp;</p><p>て変更することができます。</p><p>&nbsp;</p><p>　なお、計画期間を変更する場合も、当初計画申請時と同様に、生産性、財務健全性等の認定基準を満たさなければ、認定を受けることがで</p><p>&nbsp;</p><p>きません。</p><p>&nbsp;</p><p>&nbsp;</p><p>生産性向上の基準</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>生産性向上の基準とは何ですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　申請時点における直近の確定決算を基準年度として、計画の終了時期を含む決算年度を目標年度として、基準年度から目標年度までの向</p><p>&nbsp;</p><p>上によって次のいずれかの基準を満たす必要があります。</p><p>&nbsp;</p><p>　①修正ＲＯＡ　２％ポイント向上</p><p>&nbsp;</p><p>　②有形固定資産回転率　５％向上</p><p>&nbsp;</p><p>　③従業員1人当たり付加価値額　６％向上</p><p>&nbsp;</p><p>&nbsp;</p><p>【計算方式】</p><p>&nbsp;</p><p>&nbsp;</p><p>数値目標の算定単位は何ですか？ 　事業部門単位で算定します。なお、計画の対象となる事業部門が複数の企業に存在する場合、各社にある当該事業部門の数値を合算での算定も可能です。</p><p>&nbsp;</p><p>資本金の増加額や公開買付け後の合併条件など計画に記載すべき事項の</p><p>&nbsp;</p><p>一部が未定である場合は、どうすればよいですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　計画の一部について申請時に未定である場合については、計画中に「未定」として記載し、後で計画変更を行うことができますので、申請先の主</p><p>&nbsp;</p><p>務省庁にご相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>複数事業者（関係事業者、外国関係法人を含む）が共同で申請する場</p><p>&nbsp;</p><p>合、事業者間で決算期がズレている場合は、どうすれば良いのか？ 　実態に応じてケースバイケースで判断しますので、申請先の主務省庁にご相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>財務内容の健全性の向上の基準</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>財務内容の健全性の向上の基準とは何ですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　申請事業者（複数の場合は各事業者それぞれ）の単体で次の両方の基準を満たす必要があります。それぞれの計算手法につきましては、様</p><p>&nbsp;</p><p>式（テンプレート）の添付書面のエクセルファイルをご覧ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>計画の終了年度において次の両方の達成が見込まれること。</p><p>&nbsp;</p><p>①有利子負債／キャッシュフロー≦１０倍　②経常収入＞経常支出</p><p>&nbsp;</p><p>&nbsp;</p><p>数値目標は、連結グループで算定することはできますか？</p><p>&nbsp;</p><p>　グループ全体の資金を持株会社等が一括管理するなど、連結ベースの方が実態に即している場合には、複数事業者の連結ベースで判断する</p><p>&nbsp;</p><p>場合もあります。連結ベースの適用を検討されている場合は、申請先の主務省庁にご相談ください。</p><p>&nbsp;</p><p>&nbsp;</p><p>関係事業者の分も必要ですか？ 　一義的には申請事業者が本基準を満たすかどうかで判断しますが、計画の実行性を担保する観点から、関係事業者が基準を満たすかどうかも</p><p>&nbsp;</p><p>審査時に確認しておりますので、関係事業者の分も提出をお願いします。</p><p>&nbsp;</p><p>&nbsp;</p><p>前向きな取組の基準</p><p>&nbsp;</p><p>質問 答え</p><p>&nbsp;</p><p>&nbsp;</p><p>前向きな取組の基準とは何ですか？</p><p>&nbsp;</p><p>&nbsp;</p><p>　計画の終了年度において次のいずれかの基準を満たす必要があります。</p><p>&nbsp;</p><p>①新商品・新サービスの開発・生産・提供 ⇒　　　　新商品等の売上高比率を全社売上高の１％以上</p><p>&nbsp;</p><p>②商品の新生産方式の導入、設備の能率の向上 ⇒　　　　商品等１単位当たりの製造原価を５％以上削減</p><p>&nbsp;</p><p>③商品の新販売方式の導入、サービスの新提供方式の導入 ⇒　　　　商品等１単位当たりの販売費を５％以上削減</p><p>&nbsp;</p><p>④新原材料・部品・半製品の使用、原材料・部品・半製品の新購入方式の導入</p><p>&nbsp;</p><p>　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　　 ⇒　　 　 商品１単位当たりの製造原価を５％以上削減</p><p>&nbsp;</p><p>&nbsp;</p><p>複数事業者（関係事業者、外国関係法人を含む）が共同で申請する場</p><p>&nbsp;</p><p>合、それぞれの事業者が前向きな取組を行う必要がありますか？ 　原則として、申請に関わる事業者全員がそれぞれ前向きな取組を行う必要はありません。</p><p>&nbsp;</p><p>&nbsp;</p><p>「新商</p>'),(8,69,'2022-04-16 23:58:19','bB2N2X8B_iFClBvFkoxY',NULL,'<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>20200519STO79425_en.pdf</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Creating a sustainable food system: the EU\'s</p><p>&nbsp;</p><p>strategy</p><p>&nbsp;</p><p>&nbsp;</p><p>The EU\'s food sustainability strategy aims to protect the environment and ensure healthy</p><p>&nbsp;</p><p>food for everyone, whilst ensuring farmers’ livelihoods.</p><p>&nbsp;</p><p>&nbsp;</p><p>The food system, from production to consumption and waste, has a significant impact on the</p><p>&nbsp;</p><p>environment, health and food safety. With the Farm to Fork Strategy presented on 20 May</p><p>&nbsp;</p><p>2020, the European Commission aims to create a sustainable EU food system that safeguards</p><p>&nbsp;</p><p>food security and protects people and the natural world.</p><p>&nbsp;</p><p>&nbsp;</p><p>Setting targets</p><p>&nbsp;</p><p>&nbsp;</p><p>The strategy provides the framework for a series of laws that the Commission will propose,&nbsp;</p><p>&nbsp;</p><p>ranging from a revision of EU pesticides legislation, new EU animal welfare rules and plans to</p><p>&nbsp;</p><p>address food waste and tackle food fraud to food labelling, a carbon farming initiative and the</p><p>&nbsp;</p><p>reform of the EU farm system.</p><p>&nbsp;</p><p>&nbsp;</p><p>It will complement existing EU legislation and build a comprehensive framework that covers the</p><p>&nbsp;</p><p>whole food supply chain.</p><p>&nbsp;</p><p>&nbsp;</p><p>All the proposals will need to be negotiated with and approved by the Council and Parliament.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Creating an eco-friendly food system</p><p>&nbsp;</p><p>&nbsp;</p><p>Article</p><p>&nbsp;</p><p>30-11-2021 - 12:10</p><p>&nbsp;</p><p>20200519STO79425</p><p>&nbsp;</p><p>&nbsp;</p><p>The strategy’s key goals for 2030:</p><p>&nbsp;</p><p>• 50% reduction in the use and risk of pesticides</p><p>&nbsp;</p><p>&nbsp;</p><p>• at least 20% reduction in the use of fertilisers</p><p>&nbsp;</p><p>&nbsp;</p><p>• 50% reduction in sales of antimicrobials used for farmed animals and aquaculture</p><p>&nbsp;</p><p>&nbsp;</p><p>• 25% of agricultural land to be used for organic farming</p><p>&nbsp;</p><p>&nbsp;</p><p>EN Directorate General for CommunicationEuropean Parliament - Spokesperson: Jaume Duch GuillotContact: webmaster@europarl.eu 1 I 3</p><p>&nbsp;</p><p>&nbsp;</p><p>https://eur-lex.europa.eu/legal-content/EN/TXT/?qid=1590404602495&amp;uri=CELEX:52020DC0381</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>Although EU agriculture is the only major farm sector worldwide to have reduced its greenhouse</p><p>&nbsp;</p><p>gas emissions (by 20% since 1990), it still accounts for about 10% of greenhouse gas</p><p>&nbsp;</p><p>emissions (of which 70% are due to animals) Together with manufacturing, processing,</p><p>&nbsp;</p><p>packaging and transportation, the food sector is one the main drivers of climate change.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>According to the strategy, a shift in our way of producing, buying and consuming food is</p><p>&nbsp;</p><p>necessary to improve the environmental footprint and help mitigate climate change, whilst</p><p>&nbsp;</p><p>protecting the livelihoods of all economic actors in the food chain, by generating fairer economic</p><p>&nbsp;</p><p>returns and opening up new business opportunities.</p><p>&nbsp;</p><p>&nbsp;</p><p>The Farm to Fork Strategy is part of the European Green Deal and its goal of making the EU</p><p>&nbsp;</p><p>climate neutral by 2050, which is closely linked to the new Biodiversity Strategy 2030 and the</p><p>&nbsp;</p><p>new Common Agricultural Policy (CAP) reforms.</p><p>&nbsp;</p><p>&nbsp;</p><p>It aims to make the EU food system more robust and resilient to future crises like Covid-19 and</p><p>&nbsp;</p><p>more recurrent natural disasters such as floods or droughts.</p><p>&nbsp;</p><p>&nbsp;</p><p>Find out how the EU supports farmers&nbsp;through the CAP.</p><p>&nbsp;</p><p>&nbsp;</p><p>Ensuring affordable, healthy and sustainable food</p><p>&nbsp;</p><p>The Farm to Fork Strategy intends to ensure affordable safe and</p>',''),(9,64,'2022-04-18 09:24:56','sR0kM4AB_iFClBvFGYzP',NULL,NULL,'<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>020729準則改訂版</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>電子商取引等に関する準則</p><p>&nbsp;</p><p>&nbsp;</p><p>平成１４年 7 月</p><p>&nbsp;</p><p>&nbsp;</p><p>経済産業省</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>i</p><p>&nbsp;</p><p>&nbsp;</p><p>はじめに</p><p>&nbsp;</p><p>&nbsp;</p><p>　法令は、それが制定 ・改正された当時における技術を前提としている。この</p><p>&nbsp;</p><p>&nbsp;</p><p>ため、新たな技術の登場は、法令の規律が前提としていた紛争実態などの事実</p><p>&nbsp;</p><p>&nbsp;</p><p>に変化をもたらす。この結果、技術の進歩に応じた柔軟な法令解釈が求められ</p><p>&nbsp;</p><p>&nbsp;</p><p>るとともに、こうした解釈では対応できない事項については新たな法令の構築</p><p>&nbsp;</p><p>&nbsp;</p><p>が求められることとなる。</p><p>&nbsp;</p><p>&nbsp;</p><p>　インターネットの登場は、電子商取引をはじめとした新たな経済行為を産み</p><p>&nbsp;</p><p>&nbsp;</p><p>出している。ところが、民法を始めとする現行法の大半はこうした新たな技術</p><p>&nbsp;</p><p>&nbsp;</p><p>を前提とせずに制定されているため、電子商取引について、現行法がどのよう</p><p>&nbsp;</p><p>&nbsp;</p><p>に適用されるのかその解釈が明確であるとは必ずしも言い難く、当事者が安心</p><p>&nbsp;</p><p>&nbsp;</p><p>して電子商取引に参加できる法的な環境にあるとは言えない。本来であるなら</p><p>&nbsp;</p><p>&nbsp;</p><p>ば、現行法の解釈に関して不明確な事項があれば、判例の積み重ねによって合</p><p>&nbsp;</p><p>&nbsp;</p><p>理的なルールが自ずと明らかになるのであるが、我が国の司法制度のあり方に</p><p>&nbsp;</p><p>&nbsp;</p><p>ついては、新しい時代の要請に即した司法制度改革の議論が始まったばかりで</p><p>&nbsp;</p><p>&nbsp;</p><p>あり、当面、こうした司法による判例の積み重ねが迅速に進むことにのみ期待</p><p>&nbsp;</p><p>&nbsp;</p><p>することは難しい。</p><p>&nbsp;</p><p>&nbsp;</p><p>　この準則は、電子商取引等に関する様々な法的問題点について、民法をはじ</p><p>&nbsp;</p><p>&nbsp;</p><p>めとする関係する法律がどのように適用されるのか、その解釈を示し、取引当</p><p>&nbsp;</p><p>&nbsp;</p><p>事者の予見可能性を高め、取引の円滑化に資することを目的とするものである。</p><p>&nbsp;</p><p>&nbsp;</p><p>もとより、個別具体的な事例において現行法がどのように適用されるのかを最</p><p>&nbsp;</p><p>&nbsp;</p><p>終的に判断するのは裁判所であることは言うまでもないが、この準則が一つの</p><p>&nbsp;</p><p>&nbsp;</p><p>法解釈の叩き台となることにより、新しいルール形成の一助になることを願っ</p><p>&nbsp;</p><p>&nbsp;</p><p>ている。</p><p>&nbsp;</p><p>&nbsp;</p><p>　また、この準則は、電子商取引をめぐる様々な論点について、消費者団体、</p><p>&nbsp;</p><p>&nbsp;</p><p>事業者団体や、内閣府・法務省・公正取引委員会・文化庁など関係府省からの</p><p>&nbsp;</p><p>&nbsp;</p><p>オブザーバーの方々のご助言を頂きながら、産業構造審議会情報経済分科会</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>ii</p><p>&nbsp;</p><p>&nbsp;</p><p>ルール整備小委員会 （委員長：中山信弘東京大学教授）において取りまとめい</p><p>&nbsp;</p><p>&nbsp;</p><p>ただいた提言を踏まえ、経済産業省が現行法の解釈についての一つの考え方を</p><p>&nbsp;</p><p>&nbsp;</p><p>提示するものであり、今後電子商取引をめぐる法解釈の指針として機能するこ</p><p>&nbsp;</p><p>&nbsp;</p><p>とを期待する。</p><p>&nbsp;</p><p>&nbsp;</p><p>　さらに、この準則は、電子商取引をめぐる取引の実務、それに関する技術の</p><p>&nbsp;</p><p>&nbsp;</p><p>動向、国際的なルールメイクの状況に応じて、柔軟に改正されるべき性格のも</p><p>&nbsp;</p><p>&nbsp;</p><p>のと考えている。また、基本的な考え方を示すとともに、具体的事例における</p><p>&nbsp;</p><p>&nbsp;</p><p>考え方も示したいと考えている。そのために、実際に電子商取引に関わってい</p><p>&nbsp;</p><p>&nbsp;</p><p>る事業者や消費者から、具体的な事例について、考え方を広く募りたい。この</p><p>&nbsp;</p><p>&nbsp;</p><p>準則の中でいくつか具体例を挙げているが、これ以外にもさらに適当なものが</p><p>&nbsp;</p><p>&nbsp;</p><p>あれば、ぜひ下記へご提案頂きたい。</p><p>&nbsp;</p><p>&nbsp;</p><p>＜電子商取引等に関する準則についての連絡先＞</p><p>&nbsp;</p><p>&nbsp;</p><p>　経済産業省商務情報政策局情報経済課</p><p>&nbsp;</p><p>&nbsp;</p><p>　FAX　03-3501-6639</p><p>&nbsp;</p><p>&nbsp;</p><p>E-Mail qqibbd@meti.go.jp</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>iii</p><p>&nbsp;</p><p>&nbsp;</p><p>電子商取引等に関する準則</p><p>&nbsp;</p><p>&nbsp;</p><p>　－目次－</p><p>&nbsp;</p><p>&nbsp;</p><p>第１．オンライン取引____________________________________________________1</p><p>&nbsp;</p><p>&nbsp;</p><p>１．契約手法に関する問題________________________________________________2</p><p>&nbsp;</p><p>&nbsp;</p><p>(1) 契約の成立時期（電子承諾通知の到達）_______________________________2</p><p>&nbsp;</p><p>&nbsp;</p><p>(2) なりすましによる意思表示の当事者でない者への効果帰属_______________5</p><p>&nbsp;</p><p>&nbsp;</p><p>(3) なりすましを生じた場合の認証機関の責任____________________________14</p><p>&nbsp;</p><p>&nbsp;</p><p>(4) 未成年者による意思表示____________________________________________17</p><p>&nbsp;</p><p>&nbsp;</p><p>(5) 管轄合意条項の有効性______________________________________________19</p><p>&nbsp;</p><p>&nbsp;</p><p>２．新たな取引の発展に伴う問題_________________________________________20</p><p>&nbsp;</p><p>&nbsp;</p><p>電子商店街（サイバーモール）運営者の責任__________________________20</p><p>&nbsp;</p><p>&nbsp;</p><p>３．消費者保護_________________________________________________________23</p><p>&nbsp;</p><p>&nbsp;</p><p>(1) 消費者の操作ミスによる錯誤________________________________________23</p><p>&nbsp;</p><p>&nbsp;</p><p>(2) インターネット通販における分かりやすい申込画面の設定義務__________27</p><p>&nbsp;</p><p>&nbsp;</p><p>(3) ウェブ上の広告表示の適正化________________________________________33</p><p>&nbsp;</p><p>&nbsp;</p><p>ア）景品表示法による規制_____________________________________________33</p><p>&nbsp;</p><p>&nbsp;</p><p>イ）特定商取引法による規制___________________________________________38</p><p>&nbsp;</p><p>&nbsp;</p><p>第２．情報財取引_______________________________________________________42</p><p>&nbsp;</p><p>&nbsp;</p><p>１．ライセンス契約_____________________________________________________42</p><p>&nbsp;</p><p>&nbsp;</p><p>(1) 契約の成立とユーザーの返品の可否__________________________________43</p><p>&nbsp;</p><p>&nbsp;</p><p>　ア）情報財が媒体を介して提供される場合_______________________________43</p><p>&nbsp;</p><p>&nbsp;</p><p>イ）情報財がオンラインで提供される場合_______________________________52</p><p>&nbsp;</p><p>&nbsp;</p><p>(2) 重要事項不提供の効果______________________________________________56</p><p>&nbsp;</p><p>&nbsp;</p><p>(3) 契約中の不当条項__________________________________________________60</p><p>&nbsp;</p><p>&nbsp;</p><p>(4) 契約終了時におけるユーザーが負う義務の内容________________________63</p><p>&nbsp;</p><p>&nbsp;</p><p>(5) 契約終了の担保措置の効力__________________________________________67</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>iv</p><p>&nbsp;</p><p>&nbsp;</p><p>(6) ベンダーが負うプログラムの担保責任________________________________71</p><p>&nbsp;</p><p>&nbsp;</p><p>(7) ユーザーの知的財産権譲受人への対抗________________________________79</p><p>&nbsp;</p><p>&nbsp;</p><p>２．知的</p>'),(10,69,'2022-04-28 11:40:08','sh0kM4AB_iFClBvFGYzR',NULL,NULL,'<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>030609パブコメ概要版.PDF</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>1</p><p>&nbsp;</p><p>&nbsp;</p><p>電子商取引等に関する準則（改定案）についての</p><p>&nbsp;</p><p>&nbsp;</p><p>パブリックコメント結果の概要</p><p>&nbsp;</p><p>&nbsp;</p><p>平成 15 年 6 月 13 日</p><p>&nbsp;</p><p>&nbsp;</p><p>　　　　　　　　　　　　　　　　　　　　　　産業構造審議会情報経済分科会</p><p>&nbsp;</p><p>&nbsp;</p><p>ル ー ル 整 備 小 委 員 会</p><p>&nbsp;</p><p>&nbsp;</p><p>＜総論＞</p><p>&nbsp;</p><p>&nbsp;</p><p>○電子商取引等に関する様々な問題について関係する法律の解釈を示す電子商取引準則に対する</p><p>&nbsp;</p><p>&nbsp;</p><p>期待度は大きいという意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>○具体的事例のさらなる充実、具体的でわかり易い表記、正確かつ適切な記載を求める意見が</p><p>&nbsp;</p><p>&nbsp;</p><p>あった。</p><p>&nbsp;</p><p>&nbsp;</p><p>●今後とも各方面からの意見を広く募って、必要な点は改善して参りたい。</p><p>&nbsp;</p><p>&nbsp;</p><p>○「問題がある」と書かれていない行為については逆に「問題がない」と誤解を生じさせる可能</p><p>&nbsp;</p><p>&nbsp;</p><p>性があるのではないか、という意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>●具体例は、あくまで明記された当該事例についての考え方を示したものである。</p><p>&nbsp;</p><p>&nbsp;</p><p>○「問題がある」場合について今後の方向性を記載すべき、という意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>●準則は、あくまで一つの法解釈を示すものに過ぎない。</p><p>&nbsp;</p><p>&nbsp;</p><p>○意見提出の機会を引き続き提供し、電子商取引準則を定期的に見直すことを要請する意見が</p><p>&nbsp;</p><p>&nbsp;</p><p>あった。また、パブリック・コメントの提出期間を最低でも３０日、できる限り６０日間は確保</p><p>&nbsp;</p><p>&nbsp;</p><p>すべきという意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>●今後とも、各方面からの意見を広く求めて、柔軟に対応して参る所存。またパブコメ期間につ</p><p>&nbsp;</p><p>&nbsp;</p><p>いては、広く意見を集める観点からできるだけ長く取れるよう配慮して参りたい。</p><p>&nbsp;</p><p>&nbsp;</p><p>○電子商取引においては、ネットワーク上で個人情報のやりとりがなされる機会が多く、電子商</p><p>&nbsp;</p><p>&nbsp;</p><p>取引を行う事業者にとって、個人情報を保護し、適正に取扱うことは必須条件であり、準則にお</p><p>&nbsp;</p><p>&nbsp;</p><p>いても、電子商取引における適正な個人情報保護のあり方について検討して欲しい旨の要望が</p><p>&nbsp;</p><p>&nbsp;</p><p>あった。</p><p>&nbsp;</p><p>&nbsp;</p><p>●個人情報保護については、政令や政府の基本方針の策定動向を注視しつつ、今後検討してまい</p><p>&nbsp;</p><p>&nbsp;</p><p>りたい。</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>2</p><p>&nbsp;</p><p>&nbsp;</p><p>（総論）</p><p>&nbsp;</p><p>&nbsp;</p><p>○具体的事例の拡充を図って欲しいとの意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>○引き続き意見提出の機会を設けることを求める意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>○電子商取引と個人情報保護の関係について取り上げることを求める意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>●具体的事例の拡充については、引き続き検討してまいりたい。</p><p>&nbsp;</p><p>&nbsp;</p><p>●今後とも広く意見を求めてまいりたい。</p><p>&nbsp;</p><p>&nbsp;</p><p>●論点の追加については、引き続き検討してまいりたい。</p><p>&nbsp;</p><p>&nbsp;</p><p>第１．オンライン取引</p><p>&nbsp;</p><p>&nbsp;</p><p>１．契約手法に関する問題</p><p>&nbsp;</p><p>&nbsp;</p><p>(1)契約の成立時期</p><p>&nbsp;</p><p>&nbsp;</p><p>＜意見の概要＞</p><p>&nbsp;</p><p>&nbsp;</p><p>○ウェブ画面を通じた承諾通知の到達時期について、電子メールの場合との均衡の観点から、</p><p>&nbsp;</p><p>&nbsp;</p><p>ウェブサーバに読み取り可能な状態で記録された時点とすべきであるとの意見やウェブサー</p><p>&nbsp;</p><p>&nbsp;</p><p>バから申込者のブラウザに向けデータが送出された時点とすべきであるとの意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>○ウェブ画面に承諾通知が表示されないようになっている場合、通信障害等何らかのトラブ</p><p>&nbsp;</p><p>&nbsp;</p><p>ルで承諾通知画面が表示されなかった場合等について、承諾通知は到達したといえるのかと</p><p>&nbsp;</p><p>&nbsp;</p><p>の質問があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>○ウェブ画面では表示されなかったが、別途電子メールを送信している場合について、契約</p><p>&nbsp;</p><p>&nbsp;</p><p>は成立しているのかとの質問があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>＜考え方＞</p><p>&nbsp;</p><p>&nbsp;</p><p>●意思表示の到達時期は、受信者にとって了知可能な状態におかれたこと、すなわち、受信</p><p>&nbsp;</p><p>&nbsp;</p><p>者のいわゆる支配圏内におかれることを要すると解されている（最高裁判所昭和 36 年 4 月</p><p>&nbsp;</p><p>&nbsp;</p><p>20 日第一小法廷判決等）。電子メールにおける受信者側のメールサーバは受信者の支配圏内</p><p>&nbsp;</p><p>&nbsp;</p><p>と解されるが、ウェブサーバをこれと同様ととらえることは困難と考える。</p><p>&nbsp;</p><p>&nbsp;</p><p>●申込者のモニター画面に表示されていない場合は、承諾通知は到達していないと考える。</p><p>&nbsp;</p><p>&nbsp;</p><p>●承諾通知をウェブ画面に表示するシステムを採るとともに電子メールで承諾通知を送信し</p><p>&nbsp;</p><p>&nbsp;</p><p>た場合、申込者のモニター画面上に表示された時点または申込者のメールサーバ中のメール</p><p>&nbsp;</p><p>&nbsp;</p><p>ボックスに記録された時点のいずれか早い時点で承諾通知が到達し、契約が成立したものと</p><p>&nbsp;</p><p>&nbsp;</p><p>考える。</p><p>&nbsp;</p><p>&nbsp;</p><p>(4)未成年者による意思表示</p><p>&nbsp;</p><p>&nbsp;</p><p>＜意見の概要＞</p><p>&nbsp;</p><p>&nbsp;</p><p>○年齢確認措置の具体例を求める意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>＜考え方＞</p><p>&nbsp;</p><p>&nbsp;</p><p>●年齢確認措置の具体例については引き続き検討したい。なお、いかなる年齢確認措置を</p><p>&nbsp;</p><p>&nbsp;</p><p>採ったとしても、取消しの可能性を完全に排除することは困難と考える。</p><p>&nbsp;</p><p>&nbsp;</p><p>(5)管轄合意条項の有効性</p><p>&nbsp;</p><p>&nbsp;</p><p>＜意見の概要＞</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>3</p><p>&nbsp;</p><p>&nbsp;</p><p>○オンラインによる管轄合意を有効とする法改正を要望する意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>＜考え方＞</p><p>&nbsp;</p><p>&nbsp;</p><p>●所管行政庁において、法改正の要否を検討しているとのことである。</p><p>&nbsp;</p><p>&nbsp;</p><p>２．新たな取引の発展に伴う問題</p><p>&nbsp;</p><p>&nbsp;</p><p>(1)電子商店街（サイバーモール）運営者の責任</p><p>&nbsp;</p><p>&nbsp;</p><p>＜意見の概要＞</p><p>&nbsp;</p><p>&nbsp;</p><p>○サイバーモール運営者の責任の有無を判断する際の要素として例示した「売上代金の収納</p><p>&nbsp;</p><p>&nbsp;</p><p>代行」は「売上代金の回収の態様」とすべきであるとの意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>＜考え方＞</p><p>&nbsp;</p><p>&nbsp;</p><p>●意見を踏まえ、記述を変更する。</p><p>&nbsp;</p><p>&nbsp;</p><p>(2)インターネット・オークション</p><p>&nbsp;</p><p>&nbsp;</p><p>ア）オークション事業者の利用者に対する責任</p><p>&nbsp;</p><p>&nbsp;</p><p>＜意見の概要＞</p><p>&nbsp;</p><p>&nbsp;</p><p>○オークション事業者の責任を論ずる際に最高裁判例（新聞広告を掲載した新聞社の責任）</p><p>&nbsp;</p><p>&nbsp;</p><p>を引用しているが、引用自体は適切なものの紙面への編集権のある新聞社と掲載内容に編集</p><p>&nbsp;</p><p>&nbsp;</p><p>権を持たないオークション事業者との違いについて説明を付加すべきであるとの意見及び両</p><p>&nbsp;</p><p>&nbsp;</p><p>者の違いを理由に判例の引用部分を削除すべきであるとの意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>○オークション事業者と利用者との契約関係について消費者契約法の適用がある旨の記述に</p><p>&nbsp;</p><p>&nbsp;</p><p>とどめるのではなく、いかなる場面で何条が適用されるのか明らかにすべきであるとの意見</p><p>&nbsp;</p><p>&nbsp;</p><p>やオークションのシステムの不具合について一切保証しない契約条項は消費者契約法に違反</p><p>&nbsp;</p><p>&nbsp;</p><p>するとの意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>○オークション事業者は商法上の仲立人としての責任を負うとする意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>○オークション事業者の責任をすべて否定する考え方には反対するとの意見があった。</p><p>&nbsp;</p><p>&nbsp;</p><p>○オークション事業者の責任について定める法規制を求める意見があった。他方、インター</p><p>&nbsp;</p><p>&nbsp;</p><p>ネット・オークションに関する規制に反対する意見もあった。</p><p>&nbsp;</p><p>&nbsp;</p><p>＜考え方＞</p><p>&nbsp;</p><p>&nbsp;</p><p>●（判例の引用）意見を踏まえ、引用部分を削除するとともに、判例引用の適否について今</p><p>&nbsp;</p><p>&nbsp;</p><p>後検討してまいりたい。</p><p>&nbsp;</p><p>&nbsp;</p><p>●（消費者契約法の適用関係について）意見を踏まえ、記述を変更する。</p><p>&nbsp;</p><p>&nbsp;</p><p>●仲立人とは、他人間の商行為の媒介を業とする者である（商法第 543 条）。ここで「媒</p><p>&nbsp;</p><p>&nbsp;</p><p>介」とは他人間の法律行為の締結に尽力する事実行為とされ、これは例えば両者の間で売買</p><p>&nbsp;</p><p>&nbsp;</p><p>契約を成立させるためにいろいろと条件交渉、斡旋することであり、単なる情報提供は当た</p><p>&nbsp;</p><p>&nbsp;</p><p>らないとされる。オークション事業者は、出品者と入札者の間で条件交渉や斡旋を行わない</p><p>&nbsp;</p><p>&nbsp;</p><p>ので、通常は「仲立人」に該当しないと考える。</p><p>&nbsp;</p><p>&nbsp;</p><p>●準則改訂案においては、オークション事業者が責任を負</p>'),(11,69,'2022-04-28 13:21:55','eh0K2n8B_iFClBvFKIw5',NULL,NULL,'<p>&nbsp;</p><p>&nbsp;</p><p>test</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>- 1 -</p><p>&nbsp;</p><p>&nbsp;</p><p>財 務 省</p><p>&nbsp;</p><p>○ 告示第一号</p><p>&nbsp;</p><p>&nbsp;</p><p>経済産業省</p><p>&nbsp;</p><p>&nbsp;</p><p>産業競争力強化法（平成二十五年法律第九十八号。以下「法」という。）第二十三条第一項の規定に基</p><p>&nbsp;</p><p>&nbsp;</p><p>づき、事業再編の実施に関する指針を次のように定めたので、同条第五項の規定に基づき公表する。</p><p>&nbsp;</p><p>&nbsp;</p><p>平成二十六年一月十七日 財務大臣 麻生 太郎</p><p>&nbsp;</p><p>&nbsp;</p><p>経済産業大臣 茂木 敏充</p><p>&nbsp;</p><p>&nbsp;</p><p>事業再編の実施に関する指針</p><p>&nbsp;</p><p>&nbsp;</p><p>一 事業再編による生産性及び財務内容の健全性の向上に関する目標の設定に関する事項</p><p>&nbsp;</p><p>&nbsp;</p><p>主務大臣が法第二十三条第五項の規定により認定を行うに当たっては、事業再編計画の実施期間（三年</p><p>&nbsp;</p><p>&nbsp;</p><p>（当該事業再編計画に認定事業再編関連措置を行うのに必要な資金の貸付けを求めることが含まれる場合</p><p>&nbsp;</p><p>&nbsp;</p><p>にあっては、五年）を超えないものとする。）の終了時において、法第二条第十一項第一号に掲げる措置</p><p>&nbsp;</p><p>&nbsp;</p><p>及び同項第二号に掲げるものを行うことにより事業再編の対象となる事業部門において次のイの生産性の</p><p>&nbsp;</p><p>&nbsp;</p><p>向上に関する目標の達成が見込まれるとともに、事業再編の対象となる事業を行う事業者全体において次</p><p>&nbsp;</p><p>&nbsp;</p><p>のロの財務内容の健全性の向上に関する目標の達成が見込まれることを認定の要件とする。</p><p>&nbsp;</p><p>&nbsp;</p><p>イ 事業再編による生産性向上に関する目標</p><p>&nbsp;</p><p>&nbsp;</p><p>事業再編による生産性向上に関する目標は、事業再編計画の対象となった事業部門単位の計算におい</p><p>&nbsp;</p><p>&nbsp;</p><p>て、次のいずれかとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 事業再編計画の終了年度において減価償却費及び研究開発費を控除する前の営業利益の金額を総1</p><p>&nbsp;</p><p>資産金額で除した値を百分率で表した値が、事業再編計画の開始の直前の事業年度（以下この号にお</p><p>&nbsp;</p><p>&nbsp;</p><p>いて｢基準年度｣という。）における当該値より二以上改善していること。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 事業再編計画の終了年度における有形固定資産回転率の値が、基準年度における有形固定資産回2</p><p>&nbsp;</p><p>転率の値より五パーセント以上改善していること。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 事業再編計画の終了年度における従業員一人当たり付加価値額の値が、基準年度における従業員3</p><p>&nbsp;</p><p>一人当たり付加価値額の値より六パーセント以上改善していること。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) ( )から( )までのいずれかに相当する生産性の向上に関する他の指標が改善していること。4 1 3</p><p>&nbsp;</p><p>ロ 事業再編による財務内容の健全性の向上に関する目標</p><p>&nbsp;</p><p>&nbsp;</p><p>事業再編による財務内容の健全性の向上に関する目標は、事業再編を行う事業者単位の計算において</p><p>&nbsp;</p><p>&nbsp;</p><p>、次の( )及び( )を原則とし、これに加えて、当該事業者の業態の特性等の固有の事情を勘案して柔軟1 2</p><p>&nbsp;</p><p>に判断を行うものとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 事業再編計画の終了年度における有利子負債合計額から、現金預金及び信用度の高い有価証券等1</p><p>&nbsp;</p><p>の評価額並びに運転資金の額を控除した額を、当該終了年度における留保利益の額に減価償却費及び</p><p>&nbsp;</p><p>&nbsp;</p><p>前事業年度からの引当金増減額を加算した金額で除した値が十以下となること。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 事業再編計画の終了年度における経常収入の額が経常支出の額より大きい値となること。2</p><p>&nbsp;</p><p>&nbsp;</p><p>二 事業再編の実施方法に関する事項</p><p>&nbsp;</p><p>&nbsp;</p><p>イ 事業再編の定義に関する事項</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 保有する施設の相当程度の撤去1</p><p>&nbsp;</p><p>法第二条第十一項第一号ワの保有する施設の相当程度の撤去とは、当該撤去する施設の帳簿価額が</p><p>&nbsp;</p><p>&nbsp;</p><p>当該撤去を行う事業者の保有する全ての施設の帳簿価額の合計額の五パーセント（複数の施設を撤去</p><p>&nbsp;</p><p>&nbsp;</p><p>する場合にあっては、十パーセント）以上となるものをいうものとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 保有する設備の相当程度の廃棄2</p><p>&nbsp;</p><p>法第二条第十一項第一号ワの保有する設備の相当程度の廃棄とは、当該廃棄する設備の帳簿価額が</p><p>&nbsp;</p><p>&nbsp;</p><p>当該廃棄を行う事業者の保有する全ての設備の帳簿価額の合計額の五パーセント（複数の設備を廃棄</p><p>&nbsp;</p><p>&nbsp;</p><p>する場合にあっては、十パーセント）以上となるものをいうものとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 生産若しくは販売に係る商品の構成又は提供に係る役務の構成の相当程度の変化3</p><p>&nbsp;</p><p>法第二条第十一項第二号イの生産若しくは販売に係る商品の構成又は提供に係る役務の構成を相当</p><p>&nbsp;</p><p>&nbsp;</p><p>程度変化させることとは、当該新商品又は当該新たな役務の売上高の合計額を全ての事業の売上高の</p><p>&nbsp;</p><p>&nbsp;</p><p>一パーセント以上とすることをいうものとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 商品の生産の著しい効率化4</p><p>&nbsp;</p><p>法第二条第十一項第二号ロの商品の生産を著しく効率化することとは、当該商品に係る一単位当た</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>- 2 -</p><p>&nbsp;</p><p>&nbsp;</p><p>り製造原価を五パーセント以上低減させることをいうものとする。ただし、当該商品に係る一単位当</p><p>&nbsp;</p><p>&nbsp;</p><p>たりの材料費の低減が困難と認められる場合にあっては、製造原価から材料費を控除した額を十パー</p><p>&nbsp;</p><p>&nbsp;</p><p>セント以上低減させることとすることができるものとする。また、商品一単位当たり製造原価の低減</p><p>&nbsp;</p><p>&nbsp;</p><p>額の算定が困難と認められる場合にあっては、当該商品に係る売上原価の金額を売上高の金額で除し</p><p>&nbsp;</p><p>&nbsp;</p><p>た値を五パーセント以上（売上原価から材料費を控除する場合にあっては、十パーセント以上）低減</p><p>&nbsp;</p><p>&nbsp;</p><p>させることとすることができるものとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 商品の販売若しくは役務の提供の著しい効率化5</p><p>&nbsp;</p><p>法第二条第十一項第二号ハの商品の販売又は役務の提供を著しく効率化することとは、当該商品又</p><p>&nbsp;</p><p>&nbsp;</p><p>は役務に係る一単位当たり販売費を五パーセント以上低減させることをいうものとする。ただし、一</p><p>&nbsp;</p><p>&nbsp;</p><p>単位当たり販売費の算定が困難と認められる場合にあっては、当該商品又は役務の提供に係る販売費</p><p>&nbsp;</p><p>&nbsp;</p><p>及び一般管理費の金額を売上高の金額で除した値を五パーセント以上低減させることとすることがで</p><p>&nbsp;</p><p>&nbsp;</p><p>きるものとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 生産に係る費用の相当程度の低減6</p><p>&nbsp;</p><p>法第二条第十一項第二号ニの商品の生産に係る費用を相当程度低減することとは、当該商品に係る</p><p>&nbsp;</p><p>&nbsp;</p><p>一単位当たりの製造原価を五パーセント以上低減させることをいうものとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>ロ 事業再編の認定要件に関する事項</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 事業再編計画の円滑かつ確実な実施1</p><p>&nbsp;</p><p>法第二十三条第五項第二号の事業再編が円滑かつ確実に実施されると見込まれるものであること</p><p>&nbsp;</p><p>&nbsp;</p><p>とは、当該事業再編の内容が同条第一項の認定に係る当該事業者の技術力、販売力等に照らして過</p><p>&nbsp;</p><p>&nbsp;</p><p>度に実施困難なものでなく、かつ、当該計画の実施に必要な資金の調達が不可能なものでないこと</p><p>&nbsp;</p><p>&nbsp;</p><p>をいうものとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 過剰供給構造の解消2</p><p>&nbsp;</p><p>法第二十三条第五項第四号の過剰供給構造の解消に資するものであることとは、当該事業再編計</p><p>&nbsp;</p><p>&nbsp;</p><p>画を実施しようとする事業の属する事業分野が( )の基準に照らし過剰供給構造にあると判定される3</p><p>&nbsp;</p><p>場合において、当該事業再編計画の実施により供給能力が減少する又は需要を開拓するものである</p><p>&nbsp;</p><p>&nbsp;</p><p>ことをいうものとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>( ) 過剰供給構造にある業種又は事業分野の基準3</p><p>&nbsp;</p><p>業種又は事業分野(以下「業種等」という。）が過剰供給構造にあるかどうかを判定する基準は、</p><p>&nbsp;</p><p>&nbsp;</p><p>次の(ⅰ)により範囲を特定された業種等が、次の(ⅱ)及び（ⅲ）に該当することとする。</p><p>&nbsp;</p><p>&nbsp;</p><p>(ⅰ) 過剰供給構造の判定対象となる業種等の範囲を特定する基準</p><p>&nbsp;</p><p>&nbsp;</p><p>当面、需要の拡大が見込まれない業種等であって、生産される商品又は提供される役務の機能</p><p>&nbsp;</p><p>&nbsp;</p><p>又は効用が、需</p>'),(12,69,'2022-09-05 10:21:34','sB2nMoAB_iFClBvFWIw1',NULL,NULL,'<p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nb